def transpose(int[,] matrix) -> int[,]: new_matrix := int[matrix[0, ..].length, matrix.length]; for y := 0; y < matrix[0, *].length; y++: new_matrix[*, y] = matrix[y, *]; return new_matrix; // Transposing manually
def transpose(int[,] matrix) -> int[,]: /** The range operator has to be used here because there actually is no other way to find the length of the second dimension */ new_matrix := int[matrix[0, ..].length, matrix.length]; for x := 0; x < matrix.length; x++: for y := 0; y < matrix[0, ..].length; y++: new_matrix[y, x] = matrix[x, y]; return new_matrix; The slicing operation is not only cleaner for arrays, but it is more performant too, because multiple pieces of data can be copied simultaniously, whereas with manual indexing, each value is copied 1 by 1.

