bool has_id = false; if (is_adult and has_id): // Both must be true print("You can enter.");
else: print("Access denied."); // Output: Access denied. or Combines two conditions and evaluates to true if at least one condition is true. bool is_vip = true;
bool has_ticket = false; if (is_vip or has_ticket): // Only one must be true print("You can enter."); // Output: You can enter. not Reverses the value of a bool. bool is_raining = false; if (not is_raining): // Turns false into true print("You don’t need an umbrella!"); // Output: You don’t need an umbrella!
